actionConfiguration.body:
() =>{		
		if(CreateGSheet_NewLPC.data.webViewLink != null){
			navigateTo(CreateGSheet_NewLPC.data.webViewLink,{},'NEW_WINDOW');
		}
		else {
			CreateGSheet_NewLPC.run(
				// success
				() => {storeValue('Key_URLCreateProductLPC', CreateGSheet_NewLPC.data.webViewLink);
							 navigateTo(CreateGSheet_NewLPC.data.webViewLink,{},'NEW_WINDOW');},
				//fail
				() => {storeValue('Key_URLCreateProductLPC', '');showAlert("Something wrong happened - Can't create GSheet");}
			)
		}
	}

